    using System.Runtime.InteropServices;
    using System;

    namespace Amazon.DeviceUtils
    {

        internal static class NativeMethods
        {
            [DllImport("cfgmgr32.dll", SetLastError = true, EntryPoint = "CM_Locate_DevNode_Ex", CharSet = CharSet.Auto)]
            public static extern UInt32 LocateDevNode(ref UInt32 DevInst, IntPtr DeviceID, UInt64 Flags, IntPtr Machine);

            [DllImport("cfgmgr32.dll", SetLastError = true, EntryPoint = "CM_Reenumerate_DevNode_Ex", CharSet = CharSet.Auto)]
            public static extern UInt32 ReenumerateDevNode(UInt32 DevInst, UInt64 Flags, IntPtr Machine);

            [DllImport("cfgmgr32.dll", SetLastError = true, EntryPoint = "CMP_WaitNoPendingInstallEvents", CharSet = CharSet.Auto)]
            public static extern UInt32 WaitNoPendingInstallEvents(UInt32 TimeOut);
        }


        public static class Commands
        {

            public const UInt32 SUCCESS = 0;
            public const UInt64 REENUMERATE_SYNCHRONOUS = 1;
            public const UInt64 LOCATE_DEVNODE_NORMAL = 0;

            public static UInt32 RescanDevices()
            {
                UInt32 ExitCode = 0;
                IntPtr LocalMachineInstance = IntPtr.Zero; //Local only
                UInt32 DeviceInstance = 0;
                UInt32 PendingTime = 30000;

                //Get Device Handle
                ExitCode = NativeMethods.LocateDevNode(ref DeviceInstance, IntPtr.Zero, LOCATE_DEVNODE_NORMAL, LocalMachineInstance);

                if (ExitCode == SUCCESS)

                {
                    ExitCode = NativeMethods.ReenumerateDevNode(DeviceInstance, REENUMERATE_SYNCHRONOUS, LocalMachineInstance);
                    ExitCode = NativeMethods.WaitNoPendingInstallEvents(PendingTime);
                }

                return ExitCode;
            }
        }
    }"

