<#
 This method retrieves UserData and convert it into Json. It do retries on failure. On reaching maximum retries, it will throw the exception.
#>
function Get-JsonUserDataWithRetry
{
    param (
        [Parameter(Mandatory=$false)]
        [int] $maxRetryCount = 3,

        [Parameter(Mandatory=$false)]
        [int] $retrySleepIntervalInSeconds = 1
    )

    $downloadPath = "http://169.254.169.254/latest/user-data/"
    $content = $null
    $retryCount = 0
    do {
        try {
            $token = Invoke-RestMethod -Headers @{"X-aws-ec2-metadata-token-ttl-seconds" = "21600"} -Method PUT -Uri $tokenPath
            $content = Invoke-RestMethod -Headers @{"X-aws-ec2-metadata-token" = $token} -Method GET -Uri $downloadPath
        }catch {
            Start-Sleep -s $retrySleepIntervalInSeconds
            $retryCount++;
            if($retryCount -gt $maxRetryCount){
                throw $_.Exception
            }
        }
    } while( !$content -and ($retryCount -le $maxRetryCount))
    return $content
}

